import {useState, useEffect} from "react";
import { Form, Input, Checkbox, Button, Col } from "antd";
import { Layout } from 'antd';
import axios from 'axios';


const {Header, Content, Footer} = Layout;

const ChiTietNV = () => {
    const [componentSize, setComponentSize] = useState('default');
    const [ctnv, setCtnv] = useState([]);
    const [form] = Form.useForm()
    
    useEffect(() => {
      axios
        .get("http://localhost:5000/api/NVQL/ctnv/" + JSON.parse(window.localStorage.getItem("MaNV")))
        .then((res) => {
          console.log(res.data)
          setCtnv(res.data)
          console.log(ctnv)
        })
        .catch((err) => {
          console.log(err);
        });
      }, []);

    const onFormLayoutChange = ({ size }) => {
      setComponentSize(size);
    };
  
    
    return (
      <div>

      <Form
        labelCol={{
          span: 4,
        }}
        wrapperCol={{
          span: 14,
        }}
        layout="horizontal"
        initialValues={{
          size: componentSize,
        }}
        onValuesChange={onFormLayoutChange}
        size={componentSize}
        form={form}
      >
        
        <Form.Item label="Mã Nhân viên">
          <Input defaultValue={ctnv.MaNV} disabled/>
        </Form.Item>
        <Form.Item label="Tên Nhân viên">
          <Input defaultValue={ctnv.Ten} disabled/>
        </Form.Item>
        <Form.Item label="Giới Tính">
          <Input defaultValue={ctnv.GioiTinh} disabled/>
        </Form.Item>
        <Form.Item label="Số điện thoại">
          <Input defaultValue={ctnv.Sdt} disabled/>
        </Form.Item>
        <Form.Item label="Ngày sinh">
          <Input defaultValue={ctnv.NgaySinh} disabled/>
        </Form.Item>
        <Form.Item label="Số nhà">
          <Input defaultValue={ctnv.SoNha} disabled/>
        </Form.Item>
        <Form.Item label="Đường">
          <Input defaultValue={ctnv.Duong} disabled/>
        </Form.Item>
        <Form.Item label="Phường">
          <Input defaultValue={ctnv.Phuong} disabled/>
        </Form.Item>
        <Form.Item label="Quận">
          <Input defaultValue={ctnv.Quan} disabled/>
        </Form.Item>
        <Form.Item label="Thành Phố">
          <Input defaultValue={ctnv.ThanhPho} disabled/>
        </Form.Item>
        <Form.Item label="Email">
          <Input defaultValue={ctnv.Email} disabled/>
        </Form.Item>
        <Form.Item label="Mật Khẩu">
          <Input defaultValue={ctnv.MatKhau} disabled/>
        </Form.Item>
        <Form.Item label="Ngày Vào Làm">
          <Input defaultValue={ctnv.NgayVaolam} disabled/>
        </Form.Item>
        <Form.Item label="Lương">
          <Input defaultValue={ctnv.Luong} disabled/>
        </Form.Item>
        <Form.Item label="Đơn Hàng đã giao">
          <Input defaultValue={ctnv.DonHangDaGiao} disabled/>
        </Form.Item>
        <Form.Item label="Mã người Quản lý">
          <Input defaultValue={ctnv.MaQL} disabled/>
        </Form.Item>
        
      </Form>
      </div>
    );
  }
  
  export default ChiTietNV;
